import React from 'react';
import Tribe from './assets/Tribe.png'
import Grid from '@mui/material/Grid';
import Button from '@mui/material/Button';


const Index = () => {
  return( 
    <>   
        <Grid container sm={12} padding={5}>
            <Grid item sm={4}  container justifyContent='center'><img src={Tribe} alt='tribe' /></Grid>
            <Grid item sm={4} container justifyContent='center'><Button variant='outlined' size='small' sx={{color: 'rgb(240,255,240)', background: 'rgb(0,255,127)'}}>Assignment 1</Button></Grid>
            <Grid item sm={4} container justifyContent='center'><Button variant='outlined' size='small' sx={{background: 'rgb(0,255,127)'}}>Assignment 2</Button></Grid>
        </Grid>
    </>
    )
};

export default Index;
